import { useEffect, useState } from 'react';
import {Container,Row,Col,Table} from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import axios from 'axios'

export default function Student()
{
    const nav = new useNavigate()


    useEffect(() =>
        {

             let name = localStorage.getItem("name");


             if(!name)
             {
                 nav('/');
             }

        },[])





    let[data, setdata]= useState([]);
    let[deleted, setdeleted]= useState(false);

    useEffect(()=>
  {
      axios.post('http://localhost:3001/student/view', 
          {

          }
       )
       .then((res)=>
      {
          setdata(res.data.message);


      })
  },[deleted])



  const goto = (regno) =>
  {

    nav('/edit_student',
    {
        state : {regno : regno}
    })

  }

  const delete_data  = (regno) =>
  {
    axios.post('http://localhost:3001/student/delete', 
        {
            regno:regno
        }
     )
     .then((res)=>
    {

        alert("Data Deleted Successful");
        setdeleted(true)



    })

  }



  let goback = () =>
    {
      nav('/home')
    }



    let AddStudent = () =>
      {
        nav('/add-student')
      }

    return(
        <Container fluid>



            <Row className='m-5'>
            <Col  className='text-start'>
                 <button onClick={goback} className='btn btn-warning ms-2'>Go Back</button>
                </Col>
                <Col className='text-start'>
                <h2 className='text-info'> Student  Details</h2>

                </Col>
                <Col className='text-end'>
                 <button  onClick={AddStudent} className='btn btn-info'>Add Student</button>
                </Col>
            </Row>
            <Row>
                <Col>
                <Table>
                    <tr>
                        <th>Sno</th>
                        <th>Name</th>
                        <th>Phone</th>
                        <th>Location</th>
                        <th>Reg No</th>
                        <th>Course</th>
                        <th>Duration</th>
                        <th>Fees</th>
                        <th>Received</th>
                        <th>Pending</th>
                        <th>Balance</th>
                        <th>Status</th>
                        <th>Action</th>

                    </tr>


                    {data.map( (d,i) =>


        <tr>
        <td>{i+1}</td>
        <td>{d.name}</td> 
        <td>{d.phone}</td> 
        <td>{d.location}</td> 
        <td>{d.regno}</td> 
        <td>{d.course}</td> 
        <td>{d.duration}</td> 
        <td>{d.fees}</td> 
        <td>{d.received}</td> 
        <td>{d.pending}</td> 
        <td>{d.balance}</td> 
        <td>{d.status}</td> 

        <td><a className='text-info' onClick={()=> goto(d.regno)}>Edit</a> 
        <a className='text-danger' onClick={()=> delete_data(d.regno)}>Delete</a></td>

        </tr>



        )}



                </Table>

                </Col>
            </Row>
        </Container>
    )
}
